import React from "react";

import './styles/style.css';
import ReactDOM from 'react-dom';
import Vista1 from './Vista1';
import fondo from '../imagenes/donar.jpg';



class Home extends React.Component {
    handleClick (e) {
        ReactDOM.render(<Vista1 />, document.getElementById('root'));
    }

    render(){
        return(
            <body>
                <div className="contenedor" background="red">

                    <div className="superior">
                        <div className="importante">

                            <h1 className="primero" >DonaApp</h1>


                        </div>

                        <hr className="linea" />

                    </div>

                    <div className="inferior">

                        <div className="descripcion">
                            <p className="parrafo">Tu donación hatá alguien feliz. Hacer el bien nos hace bien</p>
                        </div>

                        <button className="boton" type="Submit"  onClick={ this.handleClick}>Ir a Donar</button>

                    </div>

                </div>

            </body>
        );
    }
}

export default Home;
